

def load_label2char():
    label2char = {}
    with open("etl1_label2char.txt", "r") as ins:
        for line in ins:
            line = line.strip()
            if line.endswith("___"):
                line += "  "
            _from, _to = line.split("___")
            if len(_from) == 1:
                _from = " " + _from
            label2char[_from] = _to
    return label2char


label2char = load_label2char()
print(label2char)

